import React from "react";

class Contact extends React.Component {
  render() {
    return (
      <div className="container-fluid d-flex justify-content-center">
        <form>
          <h1> Hello Contact</h1>
          <input type="text" />
        </form>
      </div>
    );
  }
}

export default Contact;
